import articleContent from "./ArticleContent"
function ArticlesList() {

    return (
        <>
            <h1>Articles</h1>
            <ul>
                {articleContent.map(article => {
                    <li>{article.title}</li>
                })}
            </ul>
        </>
    )

}

export default ArticlesList;
